import React from 'react';
import Menu from '../components/menu';

function sobre(props) {
    return (
        <div>
              <Menu title="Alex Ricardo - Sobre" description="Alex Ricardo desenvolvedor web" />
            <h1>Sobre</h1>
        </div>
    );
}

export default sobre;
